import Link from "next/link";
import Head from "next/head";
import Header from '../Header'

export default ({ title }) => (
  <><body>
      
    <Head>
      <meta name="viewport" content="width=device-width, initial-scale=1" />
      <title>{title || ''}</title>
    </Head>
    <Header></Header>
  </body>
  </>
);
